import React from "react";
import Typography from "@mui/material/Typography";
import HighlightOffIcon from "@mui/icons-material/HighlightOff";
import "./Shifter.css";

const Shifter = (props) => {
  const DeleteShifterHandler = () => {
    return;
  };
  return (
    <div className="myBorder">
      <Grid container direction="row" alignItems="center">
        <Grid item>
          <HighlightOffIcon
            fontSize="large"
            style={{ alignItems: "center", display: "flex", flexWrap: "wrap" }}
          />
        </Grid>
        <Grid item>
          <Typography
            variant="h6"
            gutterBottom
            component="div"
            style={{ alignItems: "center", display: "flex", flexWrap: "wrap" }}
          >
            {props.time} &nbsp;&nbsp;&nbsp;&nbsp;{props.employee}
          </Typography>
        </Grid>
      </Grid>
      {/* <Typography variant="h6" gutterBottom component="div" style={{alignItems:'center', display: 'flex', flexWrap: 'wrap'}}>
        {props.time} &nbsp;&nbsp;&nbsp;&nbsp;{props.employee}
        <HighlightOffIcon fontSize="large" style={{alignItems:'center', display: 'flex', flexWrap: 'wrap'}}/>
      </Typography> */}
    </div>
  );
};

export default Shifter;
